import React, { useEffect, useState } from 'react';
import { getMOLs } from '../services/api';

const MOL = () => {
    const [mols, setMOLs] = useState([]);

    useEffect(() => {
        getMOLs(setMOLs)
    }, []);

    return (
        <div>
            <h1>МОЛ</h1>
            <ul>
                {mols.map(mol => (
                    <li key={mol.id}>{mol.фио_мол}</li>
                ))}
            </ul>
        </div>
    );
};

export default MOL;
